// App.jsx
import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import AddItem from './components/AddItem';
import ViewItems from './components/ViewItems';
import ItemModal from './components/ItemModal';
import './App.css';

const App = () => {
  const [items, setItems] = useState([
    {
      id: 1,
      name: 'Nike Running Shoes',
      type: 'Shoes',
      description: 'High-quality running shoes.',
      coverImage: 'data:image/jpeg;base64,',
      images: ['data:image/jpeg;base64,', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTz-NzF1bJAVOwSk2OYxPx1VP3XKZMEIJh_2w&s', 'data:image/jpeg;base64,']
    },
    {
      id: 2,
      name: 'Adidas Sports T-shirt',
      type: 'Shirt',
      description: 'Breathable sportswear.',
      coverImage: 'data:image/jpeg;base64,',
      images: ['data:image/jpeg;base64,', 'data:image/jpeg;base64,','data:image/jpeg;base64,']
    }
  ]);
  const [selectedItem, setSelectedItem] = useState(null);

  return (
    <Router>
      <div className="app-wrapper">
        <nav className="navbar">
          <Link to="/view" className="nav-link">View Items</Link>
          <Link to="/add" className="nav-link">Add Item</Link>
        </nav>

        <div className="main-content">
          <Routes>
            <Route path="/" element={<Navigate to="/view" />} />
            <Route path="/add" element={<AddItem onAdd={item => setItems([...items, item])} />} />
            <Route path="/view" element={<ViewItems items={items} onView={setSelectedItem} />} />
          </Routes>
        </div>

        {selectedItem && (
          <div className="modal-backdrop">
            <ItemModal item={selectedItem} onClose={() => setSelectedItem(null)} />
          </div>
        )}
      </div>
    </Router>
  );
};

export default App;